export function Home() {
    return (
        <div class=" my-32 place-content-center grid grid-flow-col gap-4">
        <div><img className='w-60 h-80'src={lancome}/></div>
        <div><img className='w-60' src={ColorWOW}/></div>
        <div><img className='w-80 h-80' src={dyson}/></div>
        </div>
        )
}
